for (NodeMonitor monitor : NodeMonitor.getAll()) {
    if (monitor instanceof NodeMonitor.Aggregated)
        r.put(monitor.getClass().getName(),monitor.data(this));
}

NodeMonitor[] monitors = NodeMonitor.getAll();
for (int i = 0; i < monitors.length; i++)
    r.put(monitors[i].getClass().getName(), monitors[i].data(this));

